INSERT INTO "prds" VALUES('e-commerce-platform-spec','e-commerce-platform-spec','E-Commerce Platform PRD','A comprehensive PRD for a modern e-commerce platform with cart management, checkout, and order tracking.','business','["ecommerce", "retail", "payments", "cart"]','Ralphy Team',NULL,'1.1',replace('# E-Commerce Platform PRD\n\n## Overview\nA modern e-commerce platform for online retail with comprehensive shopping features.\n\n## Features\n- Product catalog with categories\n- Shopping cart management\n- Secure checkout with multiple payment options\n- Order tracking and history\n- User accounts and authentication\n- Admin dashboard for inventory management\n\n## Technical Requirements\n- Responsive design for mobile and desktop\n- Payment gateway integration\n- Real-time inventory tracking\n- Search and filtering capabilities\n\n## Success Metrics\n- Conversion rate > 3%\n- Average cart value > $75\n- Customer retention > 40%','\n',char(10)),'/specs/business/e-commerce-platform-spec.md',1,1,1,0,0,0,0,'published',0,'2026-01-21 15:06:30','2026-01-21T15:11:59.446Z','2026-01-21 15:06:30');
INSERT INTO "prds" VALUES('social-fitness-spec','social-fitness-spec','Social Fitness App PRD','A fitness and wellness app with social features, workout tracking, and community challenges.','consumer','["fitness", "social", "health", "wellness"]','Ralphy Team',NULL,'1.1',replace('# Social Fitness App PRD\n\n## Overview\nA fitness application combining personal workout tracking with social community features.\n\n## Features\n- Personal workout logging\n- Exercise library with video tutorials\n- Social feed to share workouts\n- Community challenges and leaderboards\n- Progress tracking and analytics\n- Integration with wearables\n\n## Technical Requirements\n- Cross-platform mobile app\n- Wearable device API integration\n- Real-time social feed\n- Video streaming for tutorials\n\n## Success Metrics\n- Daily active users > 50%\n- Workout completion rate > 70%\n- Social engagement rate > 30%','\n',char(10)),'/specs/consumer/social-fitness-spec.md',0,0,0,0,0,0,0,'published',0,'2026-01-21 15:06:30','2026-01-21 15:06:30','2026-01-21 15:06:30');
INSERT INTO "prds" VALUES('design-collab-spec','design-collab-spec','Design Collaboration Platform PRD','A real-time design collaboration platform for teams with versioning and feedback tools.','creative','["design", "collaboration", "creative", "figma-like"]','Ralphy Team',NULL,'1.1',replace('# Design Collaboration Platform PRD\n\n## Overview\nA cloud-based design collaboration tool for creative teams.\n\n## Features\n- Real-time collaborative design editing\n- Version control and history\n- Feedback and annotation tools\n- Component library management\n- Export to multiple formats\n- Team permissions management\n\n## Technical Requirements\n- Web-based canvas editor\n- Real-time WebSocket collaboration\n- Vector graphics rendering engine\n- Cloud storage for assets\n\n## Success Metrics\n- Project collaboration rate > 80%\n- File export success rate > 99%\n- Team adoption within first month > 70%','\n',char(10)),'/specs/creative/design-collab-spec.md',0,0,0,0,0,0,0,'published',0,'2026-01-21 15:06:30','2026-01-21 15:06:30','2026-01-21 15:06:30');
INSERT INTO "prds" VALUES('api-gateway-spec','api-gateway-spec','Vortex API Gateway PRD','A cloud-native API gateway with authentication, rate limiting, and observability for microservices.','developer','["api", "gateway", "microservices", "backend"]','Ralphy Team',NULL,'1.1',replace('# Vortex API Gateway PRD\n\n## Overview\nA modern API gateway for managing microservices communication.\n\n## Features\n- API routing and load balancing\n- Authentication and authorization (OAuth2, JWT)\n- Rate limiting and throttling\n- Request/response transformation\n- API analytics and monitoring\n- Circuit breaker pattern\n\n## Technical Requirements\n- High performance proxying\n- Plugin architecture\n- Real-time metrics dashboard\n- Auto-scaling capabilities\n- Support for multiple protocols (HTTP, WebSocket, gRPC)\n\n## Success Metrics\n- Request latency < 10ms\n- 99.99% uptime\n- Auto-scaling response time < 30s','\n',char(10)),'/specs/developer/api-gateway-spec.md',0,0,0,0,0,0,0,'published',0,'2026-01-21 15:06:30','2026-01-21 15:06:30','2026-01-21 15:06:30');
INSERT INTO "prds" VALUES('lms-spec','lms-spec','Learning Management System PRD','An LMS for online courses with progress tracking, assessments, and certifications.','education','["education", "lms", "courses", "learning"]','Ralphy Team',NULL,'1.1',replace('# Learning Management System PRD\n\n## Overview\nA comprehensive platform for delivering online courses and training programs.\n\n## Features\n- Course creation and management\n- Student enrollment and progress tracking\n- Interactive quizzes and assessments\n- Video and content hosting\n- Discussion forums and Q&A\n- Certification generation\n- Analytics dashboards\n\n## Technical Requirements\n- SCORM compliance\n- Video streaming infrastructure\n- Assessment engine\n- Real-time progress synchronization\n- Mobile-responsive design\n\n## Success Metrics\n- Course completion rate > 75%\n- Student satisfaction score > 4.5/5\n- Average time to certification < 6 weeks','\n',char(10)),'/specs/education/lms-spec.md',0,0,0,0,0,0,0,'published',0,'2026-01-21 15:06:30','2026-01-21 15:06:30','2026-01-21 15:06:30');
INSERT INTO "prds" VALUES('telemedicine-app-spec','telemedicine-app-spec','Telemedicine App PRD','A telemedicine platform for virtual consultations, prescriptions, and health records.','health','["health", "telemedicine", "medical", "healthcare"]','Ralphy Team',NULL,'1.1',replace('# Telemedicine App PRD\n\n## Overview\nA secure platform for virtual medical consultations and health management.\n\n## Features\n- Video consultations with doctors\n- Appointment scheduling\n- Prescription management\n- Electronic health records (EHR)\n- Secure messaging\n- Payment processing\n- Lab results integration\n\n## Technical Requirements\n- HIPAA compliant infrastructure\n- HD video streaming\n- EHR system integration\n- Secure data encryption\n- Two-factor authentication\n\n## Success Metrics\n- Consultation completion rate > 90%\n- Patient satisfaction > 4.7/5\n- Average appointment wait time < 5 minutes','\n',char(10)),'/specs/health/telemedicine-app-spec.md',0,0,0,0,0,0,0,'published',0,'2026-01-21 15:06:30','2026-01-21 15:06:30','2026-01-21 15:06:30');
INSERT INTO "prds" VALUES('inventory-tracking-spec','inventory-tracking-spec','Inventory Tracking System PRD','An inventory and warehouse management system with barcode scanning and analytics.','operations','["inventory", "warehouse", "operations", "logistics"]','Ralphy Team',NULL,'1.1',replace('# Inventory Tracking System PRD\n\n## Overview\nA comprehensive inventory management solution for warehouses and retail operations.\n\n## Features\n- Real-time inventory tracking\n- Barcode/QR code scanning\n- Multi-location support\n- Low stock alerts\n- Purchase order management\n- Analytics and reporting\n- Integration with POS systems\n\n## Technical Requirements\n- Mobile scanning application\n- Real-time cloud sync\n- Barcode scanning SDK integration\n- Automated alert systems\n- REST API for third-party integrations\n\n## Success Metrics\n- Inventory accuracy > 99.5%\n- Stockout reduction > 40%\n- Cycle time improvement > 30%','\n',char(10)),'/specs/operations/inventory-tracking-spec.md',0,0,0,0,0,0,0,'published',0,'2026-01-21 15:06:30','2026-01-21 15:06:30','2026-01-21 15:06:30');
INSERT INTO "prds" VALUES('community-event-spec','community-event-spec','Community Event Platform PRD','A platform for organizing local events, meetups, and community gatherings.','other','["events", "community", "social", "meetups"]','Ralphy Team',NULL,'1.1',replace('# Community Event Platform PRD\n\n## Overview\nA platform for discovering and organizing local community events.\n\n## Features\n- Event creation and management\n- Event discovery and search\n- RSVP and ticketing\n- Calendar integration\n- Event reminders\n- Photo sharing and reviews\n\n## Technical Requirements\n- Mobile-first responsive design\n- Geolocation-based recommendations\n- Secure payment processing\n- Calendar API integration\n- Push notification system\n\n## Success Metrics\n- Monthly active users > 10,000\n- Event attendance rate > 60%\n- User-generated content rate > 40%','\n',char(10)),'/specs/other/community-event-spec.md',0,0,0,0,0,0,0,'published',0,'2026-01-21 15:06:30','2026-01-21 15:06:30','2026-01-21 15:06:30');
INSERT INTO "prds" VALUES('pm-tool-spec','pm-tool-spec','Project Management Tool PRD','A project management tool with task boards, time tracking, and team collaboration.','productivity','["project-management", "productivity", "tasks", "collaboration"]','Ralphy Team',NULL,'1.1',replace('# Project Management Tool PRD\n\n## Overview\nA modern project management platform for agile teams.\n\n## Features\n- Kanban and list views\n- Task creation and assignment\n- Time tracking\n- Team collaboration and comments\n- File sharing and attachments\n- Sprint planning\n- Progress reports and analytics\n\n## Technical Requirements\n- Real-time collaboration\n- Drag-and-drop interface\n- Integration with popular tools (Slack, GitHub, Jira)\n- Mobile application\n- Webhook API for integrations\n\n## Success Metrics\n- Task completion rate > 85%\n- Team adoption within first month > 80%\n- Average task cycle time < 5 days','\n',char(10)),'/specs/productivity/pm-tool-spec.md',0,0,0,0,0,0,0,'published',0,'2026-01-21 15:06:30','2026-01-21 15:06:30','2026-01-21 15:06:30');
